import React from 'react';
import AppBar from '@material-ui/core/AppBar';
import Button from '@material-ui/core/Button';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import CssBaseline from '@material-ui/core/CssBaseline';
import Grid from '@material-ui/core/Grid';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';
import {Link} from 'react-router-dom';
import RaisedButton from 'material-ui/RaisedButton'
import MuiThemeProvider from 'material-ui/styles/MuiThemeProvider'



const useStyles = makeStyles(theme => ({
  icon: {
    marginRight: theme.spacing(2),
  },
  heroContent: {
    backgroundColor: theme.palette.background.paper,
    padding: theme.spacing(8, 0, 6),
  },
  heroButtons: {
    marginTop: theme.spacing(4),
  },
  cardGrid: {
    paddingTop: theme.spacing(8),
    paddingBottom: theme.spacing(8),
  },
  card: {
    height: '100%',
    display: 'flex',
    flexDirection: 'column',
  },
  cardMedia: {
    paddingTop: '56.25%', // 16:9
  },
  cardContent: {
    flexGrow: 1,
  },
  footer: {
    backgroundColor: theme.palette.background.paper,
    padding: theme.spacing(6),
  },
  button:{
    marginLeft: 1750
  }
}));

function lg() {
    return( localStorage.clear())
  }


export default function Dashboard() {




  const classes = useStyles();

  return (
    <MuiThemeProvider>
    <React.Fragment>

      <CssBaseline />
      <AppBar position="relative">

        <Toolbar>
          {/* <CameraIcon className={classes.icon} /> */}
          <Typography variant="h6" color="inherit" noWrap>
            Dashboard          
             <Link to = "/">
          <RaisedButton
            label ="Logout"
            primary = {true}
            variant="contained"
            onClick = {lg}
            className = {classes.button}     
            />
            </Link>
          </Typography>
        </Toolbar>
      </AppBar>

      <main>
        {/* Hero unit */}
        <div className={classes.heroContent}>
          <Container maxWidth="sm">
            <Typography component="h1" variant="h2" align="center" color="textPrimary" gutterBottom>
              STET Exam
            </Typography>
            <Typography variant="h5" align="center" color="textSecondary" paragraph>
             An eligibility exam for teachers by the Government of Sikkim.
            </Typography>
          </Container>
        </div>
        <Container className={classes.cardGrid} maxWidth="md">
          {/* End hero unit */}
          <Grid container spacing={4}>

              <Grid item xs={12} sm={6} md={6}>
              <Link to = '/userform'>
                <Card className={classes.card}>
                <CardMedia
                    className={classes.cardMedia}
                    image="https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcQDH3C2a2oRdVlgJ4jzLq79GinnSK9D6KRlbHZaM7ktVur4x_Ql"
                    title="Image title"
                  />
                  <CardContent className={classes.cardContent}>
                    <Typography gutterBottom variant="h5" component="h2">
                      Fill Form
                    </Typography>
                  </CardContent>
                  <CardActions>

                  </CardActions>
                </Card>
                </Link>
              </Grid>



              <Grid item xs={12} sm={6} md={6}>
              <Link to = '/hallticket'>
                <Card className={classes.card}>
                <CardMedia
                    className={classes.cardMedia}
                    image="data:image/jpeg;base64,"
                    title="Image title"
                  />
                  <CardContent className={classes.cardContent}>
                    <Typography gutterBottom variant="h5" component="h2">
                      Download HallTicket
                    </Typography>
                  </CardContent>
                  <CardActions>
                  </CardActions>
                </Card>
                </Link>
              </Grid>






              <Grid item xs={12} sm={6} md={6}>
              <Link to = '/profile'>
                <Card className={classes.card}>
                <CardMedia
                    className={classes.cardMedia}
                    image="https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcS-TkKPOC27KicANELOAjnl0k6EIxQBbAyc11dvFrhcCaJLJ7Ob"
                    title="Image title"
                  />
                  <CardContent className={classes.cardContent}>
                    <Typography gutterBottom variant="h5" component="h2">
                      View Profile
                    </Typography>
                  </CardContent>
                  <CardActions>


                  </CardActions>
                </Card>
                </Link>
              </Grid>


              <Grid item xs={12} sm={6} md={6}>
              <Link to = '/hallticket'>
                <Card className={classes.card}>
                <CardMedia
                    className={classes.cardMedia}
                    image="data:image/png;base64,"
                    title="Image title"
                  />
                  <CardContent className={classes.cardContent}>
                    <Typography gutterBottom variant="h5" component="h2">
                      View Results
                    </Typography>
                  </CardContent>
                  <CardActions>


                  </CardActions>
                </Card>
                </Link>
              </Grid>

          </Grid>
        </Container>
      </main>


    </React.Fragment>
     </MuiThemeProvider>

  );
}
